'use strict'
var React = require('react-native');
var {
  Component,
} = React;


class  MatchTool extends Component{
    constructor(props){
      super(props);
    }

    static getIndexName(name){      
      var indexName = name.toUpperCase().replace(' ','').replace('\t','');      
      return indexName;
    }


}

module.exports.MatchTool = MatchTool;